import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
  <BrowserRouter>
    <GoogleOAuthProvider clientId={GOOGLE_CLIENTID}>
      <App />
    </GoogleOAuthProvider>

  </BrowserRouter>,
  document.getElementById('root')
);
